import React from 'react';

class LateralMenu extends React.Component{
	getStyle = () => {
		return {
			float: 'left',
			background: '#ccc',
			padding: '20px',
			width: '30%',
			height: '100vh'
		}
	}

	getStyle2 = () => {
		return {
			background: '#f4f4f4',
			margin: '10px'
		}
	}

	render(){
		return(
			<div>
			<div style={this.getStyle()}>
				<p>Companies</p>
				<p>Usuários</p>
				<p>Resetar Senha</p>
				<p>Simulação</p>
			</div>

			<div style={this.getStyle2()}>
				<p>Companies</p>
				<p>Usuários</p>
				<p>Resetar Senha</p>
				<p>Simulação</p>
			</div></div>
		);
	}
}

export default LateralMenu;
